"url:webview/utils/templates/chrome_support.html":'\x3cdiv\x3e\n\x3cp\x3eSimulink Web View cannot be viewed in Google Chrome or any Chromium-based browser (for example,  Opera) because of local file security restrictions. To allow local file access, try the following:\x3c/p\x3e\n\x3ch4\x3eMicrosoft Windows\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eClick the \x3cb\x3eStart\x3c/b\x3e button and search for the browser executable,  such as "Chrome".\x3c/li\x3e\n\x3cli\x3eRight-click and drag the matched browser search result to an open area. Select \x3cb\x3eCreate shortcuts here\x3c/b\x3e.\x3c/li\x3e\n\x3cli\x3eRight-click the newly created shortcut and select \x3cb\x3eProperties\x3c/b\x3e.\x3c/li\x3e\n\x3cli\x3eClick the \x3cb\x3eShortcut\x3c/b\x3e tab.\x3c/li\x3e\n\x3cli\x3eIn the target edit box, append "--allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3cli\x3eClick \x3cb\x3eOK\x3c/b\x3e to dismiss property dialog box.\x3c/li\x3e\n\x3cli\x3eVerify that the browser is no longer running.\x3c/li\x3e\n\x3cli\x3eDouble-click on the newly created shortcut to start the browser.\x3c/li\x3e\n\x3c/ol\x3e\n\x3ch4\x3eMac\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eRun Terminal.app.\x3c/li\x3e\n\x3cli\x3eType "open /Applications Google\\ Chrome.app --allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3c/ol\x3e\n\x3ch4\x3eLinux\x3c/h4\x3e\n\x3col\x3e\n\x3cli\x3eStart terminal.\x3c/li\x3e\n\x3cli\x3eType "./chromium-browser --allow-file-access-from-files", with no quotes.\x3c/li\x3e\n\x3c/ol\x3e\n\x3c/div\x3e\n',
